import React from 'react';
import './FloatingCharacter.css';

const FloatingCharacter = () => {
  return (
    <div className="spider-container">
      <svg className="spider" viewBox="0 0 100 100">
        {/* Abdomen - oval, main body (opisthosoma) */}
        <ellipse cx="50" cy="58" rx="15" ry="24" fill="#1a1a1a" stroke="#0d0d0d" strokeWidth="0.5" />
        
        {/* Cephalothorax - head-thorax (smaller, darker) */}
        <ellipse cx="50" cy="20" rx="12" ry="10" fill="#2c2c2c" stroke="#0d0d0d" strokeWidth="0.5" />
        
        {/* Eyes - 8 mắt như nhện thực */}
        <circle cx="44" cy="17" r="1.5" fill="#ff6b00" opacity="0.9" />
        <circle cx="56" cy="17" r="1.5" fill="#ff6b00" opacity="0.9" />
        <circle cx="42" cy="24" r="1" fill="#ff8c00" opacity="0.7" />
        <circle cx="58" cy="24" r="1" fill="#ff8c00" opacity="0.7" />
        <circle cx="46" cy="27" r="0.8" fill="#ffa500" opacity="0.5" />
        <circle cx="54" cy="27" r="0.8" fill="#ffa500" opacity="0.5" />
        
        {/* Pedicel - connector */}
        <line x1="50" y1="30" x2="50" y2="34" stroke="#1a1a1a" strokeWidth="1" />
        
        {/* Spinnerets - rear indicator */}
        <circle cx="48" cy="80" r="0.8" fill="#2c2c2c" opacity="0.6" />
        <circle cx="52" cy="80" r="0.8" fill="#2c2c2c" opacity="0.6" />
        
        {/* Spider Web - tơ từ spinnerets */}
        <g className="web-line web-left">
          <line x1="48" y1="80" x2="30" y2="120" stroke="#e8e8e8" strokeWidth="0.8" opacity="0.6" />
        </g>
        <g className="web-line web-right">
          <line x1="52" y1="80" x2="70" y2="120" stroke="#e8e8e8" strokeWidth="0.8" opacity="0.6" />
        </g>
        <g className="web-line web-center">
          <line x1="50" y1="80" x2="50" y2="130" stroke="#e8e8e8" strokeWidth="0.6" opacity="0.5" />
        </g>
        
        {/* Front Left Leg 1 - nâng trước, bước dài */}
        <g className="leg-1">
          <path d="M 37 20 L 20 8 L 8 2 L 1 -2" stroke="#0d0d0d" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Front Left Leg 2 */}
        <g className="leg-2">
          <path d="M 35 28 L 15 26 L 2 22 L -4 18" stroke="#0d0d0d" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Front Right Leg 1 */}
        <g className="leg-5">
          <path d="M 63 20 L 80 8 L 92 2 L 99 -2" stroke="#0d0d0d" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Front Right Leg 2 */}
        <g className="leg-6">
          <path d="M 65 28 L 85 26 L 98 22 L 104 18" stroke="#0d0d0d" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Back Left Leg 1 - nâng sau, bước xuống */}
        <g className="leg-3">
          <path d="M 38 68 L 20 82 L 6 94 L -2 104" stroke="#0d0d0d" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Back Left Leg 2 */}
        <g className="leg-4">
          <path d="M 42 82 L 25 96 L 12 108 L 2 118" stroke="#0d0d0d" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Back Right Leg 1 */}
        <g className="leg-7">
          <path d="M 62 68 L 80 82 L 94 94 L 102 104" stroke="#0d0d0d" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
        
        {/* Back Right Leg 2 */}
        <g className="leg-8">
          <path d="M 58 82 L 75 96 L 88 108 L 98 118" stroke="#0d0d0d" strokeWidth="2.2" fill="none" strokeLinecap="round" strokeLinejoin="round" />
        </g>
      </svg>
    </div>
  );
};

export default FloatingCharacter;
